const Heading = () => {
  return (
    <div style={{textAlign:"center"}}>

        <h2 style={{marginLeft:"10vw", marginRight:"10vw", fontSize:"1.2em", fontFamily:"", fontWeight:"bold"}}>Agriculture is the backbone of our economy, and the health of crops and livestock is critical to ensuring food security and sustainable farming practices. Our portal leverages cutting-edge Artificial Intelligence (AI) to provide farmers with easy-to-use tools for diagnosing and reporting diseases. Whether you're in a remote area or have limited resources, our platform is designed to support you in managing the health of your farm.</h2>

    </div>
  )
}

export default Heading
